	"sap/ui/layout/designtime/messagebundle_ca.properties":'#This is the resource bundle for the sap.ui.layout library\n#\n\n#XMSG: Message when removing a SimpleForm toolbar\nMSG_REMOVING_TOOLBAR=La cap\\u00E7alera d\'aquest grup cont\\u00E9 elements addicionals. Si elimineu el grup, es suprimiran. Voleu eliminar el grup igualment?\n\n#XMIT: Context Menu Entry or Dialog Title will be enhanced with this key user friendly control type name: Group\nGROUP_CONTROL_NAME=Grup\n#XTIT: Context Menu Entry or Dialog Title will be enhanced with this key user friendly control type name: Groups\nGROUP_CONTROL_NAME_PLURAL=Grups\n#XMIT: Context Menu Entry or Dialog Title will be enhanced with this key user friendly control type name: Field\nFIELD_CONTROL_NAME=Camp\n#XTIT: Context Menu Entry or Dialog Title will be enhanced with this key user friendly control type name: Fields\nFIELD_CONTROL_NAME_PLURAL=Camps\n\n#XMIT: Horizontal layout control name caption\nHORIZONTAL_LAYOUT_CONTROL_NAME=Contenidor horitzontal\n\n#XTIT: Horizontal layout control name plural caption\nHORIZONTAL_LAYOUT_CONTROL_NAME_PLURAL=Contenidors horitzontals\n\n#XMIT: Vertical layout control name caption\nVERTICAL_LAYOUT_CONTROL_NAME=Contenidor vertical\n\n#XTIT: Vertical layout control name plural caption\nVERTICAL_LAYOUT_NAME_PLURAL=Contenidors verticals\n\n#XMIT: Grid control name caption\nGRID_CONTROL_NAME=Trama\n\n#XTIT: Grid control name plural caption\nGRID_CONTROL_NAME_PLURAL=Trames\n',
	"sap/ui/layout/designtime/messagebundle_cs.properties":'#This is the resource bundle for the sap.ui.layout library\n#\n\n#XMSG: Message when removing a SimpleForm toolbar\nMSG_REMOVING_TOOLBAR=Hlavi\\u010Dka t\\u00E9to skupiny obsahuje dopl\\u0148kov\\u00E9 prvky. Pokud skupinu odstran\\u00EDte, vyma\\u017Eou se. Chcete skupinu p\\u0159esto odstranit?\n\n#XMIT: Context Menu Entry or Dialog Title will be enhanced with this key user friendly control type name: Group\nGROUP_CONTROL_NAME=Skupina\n#XTIT: Context Menu Entry or Dialog Title will be enhanced with this key user friendly control type name: Groups\nGROUP_CONTROL_NAME_PLURAL=Skupiny\n#XMIT: Context Menu Entry or Dialog Title will be enhanced with this key user friendly control type name: Field\nFIELD_CONTROL_NAME=Pole\n#XTIT: Context Menu Entry or Dialog Title will be enhanced with this key user friendly control type name: Fields\nFIELD_CONTROL_NAME_PLURAL=Pole\n\n#XMIT: Horizontal layout control name caption\nHORIZONTAL_LAYOUT_CONTROL_NAME=Horizont\\u00E1ln\\u00ED kontejner\n\n#XTIT: Horizontal layout control name plural caption\nHORIZONTAL_LAYOUT_CONTROL_NAME_PLURAL=Horizont\\u00E1ln\\u00ED kontejnery\n\n#XMIT: Vertical layout control name caption\nVERTICAL_LAYOUT_CONTROL_NAME=Vertik\\u00E1ln\\u00ED kontejner\n\n#XTIT: Vertical layout control name plural caption\nVERTICAL_LAYOUT_NAME_PLURAL=Vertik\\u00E1ln\\u00ED kontejnery\n\n#XMIT: Grid control name caption\nGRID_CONTROL_NAME=M\\u0159\\u00ED\\u017Eka\n\n#XTIT: Grid control name plural caption\nGRID_CONTROL_NAME_PLURAL=M\\u0159\\u00ED\\u017Eky\n',
